import{_ as e,c as o,o as s,b as t}from"./app.5b22e94d.js";const v=JSON.parse('{"title":"七月最后一天","description":"","frontmatter":{"title":"七月最后一天","date":"2020-08-01T00:00:00.000Z","draft":false,"tags":[2020]},"headers":[],"relativePath":"note/2020/20200801.md"}'),n={name:"note/2020/20200801.md"},_=t("p",null,"今天是七月最后一天，我一看时间，才发现已经好几天没写日记了，最近发生很多事情，首先是上周末结束的时候，我脸上长了好几个痘痘，简直惨不忍睹，而且有两个特别大，左右脸各一个，特别扎眼，这导致我的自信心是受到不少的挫折，不爱出门，不起见人，虽然以前也是一样，现在更加严重了。",-1),a=t("p",null,"这周是和平了一周，我的各项工作都有序开展，更为重要的是，有一种成就感，这种成就感就是，到了自己熟悉的领域，很快就能把问题解决，倒也证明了一下，我并不是一无是处。",-1),l=t("p",null,"今天这天气很奇怪，天光明晃晃的，但是没有太阳，厚厚的云层，但是并不阴暗，仿佛是要下雨，但是没有雨，而且周围的车辆好像减少了，建筑工地也没有作业，难得的清静时刻。",-1),c=t("p",null,"我昨天看了什么？一个关于尼采的视频，一个人的思想有多深邃，完全可以透过他的文字看出来，当深到不可见底的时候，他就疯了。这个时候，完完全全的颠覆了所有的认知，只是口中喃喃道：“我是这样这样的一个人，千万不要把我和任何他们放到一起。”可以看出来，完全的自我认知建立之后，就会变得遗世独立，不与任何事物融为一体，仿佛与世间成为两个独立的存在。当热，客观是不允许这样存在的，所以会毁灭。",-1),d=t("p",null,"人类生下来，好像就划定了上线与下线，大多数人都在中间徘徊，终其一生，少数人向着上线或者下线冲锋，极少数人可以到达某一个线，当达到某个线的时候，完全变成另一种存在，好像被触发了某个按钮，变得疯癫，变得悲惨，就不允许那些到达界限的人传达他们的见识与思想，不允许分享其中的秘密。",-1),r=t("p",null,"好像是试验品，只不过数量庞大，从中选优，又有自然法则左右其中，变量繁多，所以难以掌握其中规律，因此意识到这件事情本是，就是一件及其困难的事情。",-1),i=t("p",null,"最后就是，最近的项目计划，因为我又开始写爬虫了，但是爬一点数据对我来说，不是什么大问题，但是要利用数据的价值，对我来说才是最有难度的，所以我又开始无限设想，也许我们可以先从提供搜索服务入手，专注于一个领域的搜索，提升自己的响应速度和准确度，等积累到了一定经验，再横向扩展。因为互联网。本身就是处理信息的，我们先从一个简单路子出发，然后开始延伸，肯定是可行的，借用无名之辈中的台词：“做大做强，再创辉煌。”",-1),p=t("p",null,"七月的最后一天，我脑子里充满了奇妙的冒险，希望以后的每一天，都是如此。",-1),u=[_,a,l,c,d,r,i,p];function h(f,m,$,x,B,g){return s(),o("div",null,u)}const N=e(n,[["render",h]]);export{v as __pageData,N as default};
